import React from 'react';
import './App.css';
import Input from './components/Input';
import TodoItem from './components/TodoItem';

const todoList = [{
  item: 'todo',
  done: false,
  id: 343412346234
},{
  item: 'todo',
  done: true,
  id: 252153
}]

function App() {
  return (
    <div className="App">
      <div className="app__container">
        <div className="add_todoContainer">
          {
            todoList.map(item => (
              <TodoItem
                name={item.item}
                done={item.done}
                id={item.id}
              />
            ))
          }
        </div>

        <Input />
      </div>
    </div>
  );
}

export default App;
